import React from 'react';
import ReactDOM from 'react-dom';
import './assets/fonts/HelveticaNeue.ttf'
import './index.scss';
import './App.scss'
import Gallery from './jsx/Pages/gallery'
import lunchboxes from './imgs/lunchboxes';
import Router from './jsx/router';
import Header from './jsx/Components/header'
ReactDOM.render(<Gallery imgDetails={lunchboxes}></Gallery>, document.getElementById('root'));



// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
